import React from 'react';
import { FullPage, Slide } from '@fullpage/react-fullpage';

const App = () => {
  return (
    <FullPage controls>
      <Slide>
        <div className="section">
          <h1>Section 1</h1>
        </div>
      </Slide>
      <Slide>
        <div className="section">
          <h1>Section 2</h1>
        </div>
      </Slide>
      <Slide>
        <div className="section">
          <h1>Section 3</h1>
        </div>
      </Slide>
    </FullPage>
  );
};

export default App;
